resource/Integrated.html.body:
Integrate SDK
Preparation for Integration
1、Create Project
Build your project in the Android Studio.
2、Configure the build.gradle
build.gradle 
Add the following codes to the build.gradle file.
defaultConfig {
    ndk {
        abiFilters "armeabi-v7a"
    }
 }
    dependencies {
        implementation fileTree(dir: 'libs', include: ['*.jar', '*.aar'])
        implementation 'com.alibaba:fastjson:1.1.67.android'
        implementation 'com.squareup.okhttp3:okhttp-urlconnection:3.12.3'
        implementation 'org.eclipse.paho:org.eclipse.paho.client.mqttv3:1.2.0'

       // required tuya home sdk
       implementation 'com.tuya.smart:tuyasmart:3.12.4'

       // tuya camera module
      implementation 'com.tuya.smart:tuyasmart-ipc-camera-middleware:3.14.3r133'
      implementation 'com.tuya.smart:tuyasmart-ipc-camera-v2:3.14.4r134'
      implementation 'com.tuya.smart:tuyasmart-ipc-camera-utils:3.13.0r128'
      implementation 'com.tuya.smart:tuyasmart-ipc-camera-message:3.13.0r128'
      implementation 'com.tuya.smart:tuyasmart-ipc-devicecontrol:3.14.3r133'

      //Mall components
      implementation 'com.tuya.smart:tuyasmart-webcontainer:3.12.6r125'
      implementation 'com.tuya.smart:tuyasmart-xplatformmanager:1.0.0'
      implementation "com.tuya.smart:tuyasmart-base:3.13.0r127"
      implementation 'com.tuya.smart:tuyasmart-appshell:3.10.0'
      implementation "com.tuya.smart:tuyasmart-stencilwrapper:3.13.0r127"
      implementation "com.tuya.smart:tuyasmart-framework:3.13.0r127-open-rc.1"
      implementation 'com.tuya.smart:tuyasmart-uispecs:0.0.3'
    }

repositories {
    mavenLocal()
    jcenter()
    google()
}


【Tips】 TuyaSmart Camera Android sdk solely supports the platform of armeabi-v7a

3、Set the AndroidManifest.xml
Set appkey and appSecret in the AndroidManifest.xml file, and configure corresponding permissions, etc.















4、proguard-rules
Arrange aliasing configuration in corresponding proguard-rules.pro files.
#fastJson
-keep class com.alibaba.fastjson.**{*;}
-dontwarn com.alibaba.fastjson.**

#mqtt
-keep class org.eclipse.paho.client.mqttv3.** { *; }
-dontwarn org.eclipse.paho.client.mqttv3.**

#tutk
-keep class com.tutk.**{*;}
-dontwarn com.tutk.**

-keep class com.squareup.okhttp.** { *; }
-keep interface com.squareup.okhttp.** { *; }
-dontwarn com.squareup.okhttp.**

-keep class okio.** { *; }
-dontwarn okio.**

-keep class com.tuya.**{*;}
-dontwarn com.tuya.**
-keep class com.tuyasmart.**{*;}
-dontwarn com.tuyasmart.**

resource/wifi_config.html.body:
Camera network configuration
Introduction
Tuya IPC cameras mainly support the following configuration methods：

EZ mode 
AP mode
QRcode mode


The QR code mode is relatively simple. It is recommended to use a QR code to configure the network. If the device cannot scan the QR code, try EZ mode.

EZ mode & AP mode  can be checked  through Tuya Smart Android SDK network configuration document, This document focuses on Qrcode configuration.
Use
Get current WIFI SSID
WiFiUtil.getCurrentSSID()

Get activator token
Token is valid in 10min, and become invalid once completely set（need to get Token again for next configuration） . Get Token as follows:
void getActivatorToken(final long homeId, final ITuyaActivatorGetToken activatorGetToken);

Parameter Description



Parameter
Description




homeid
Home Id


ITuyaActivatorGetToken
Get token callback



Sample code
//need homeid
TuyaHomeSdk.getActivatorInstance().getActivatorToken (homeid, new ITuyaActivatorGetToken() {
            @Override
            public void onSuccess(String token) {
                // get token successfully
            }

            @Override
            public void onFailure(String s, String s1) {
                // get token unsuccessfully
            }
        })

TuyaCameraActivatorBuilder
Create TuyaCameraActivatorBuilder to save  Qrcode url information and callback interface. The method is shown below.
TuyaCameraActivatorBuilder builder = new TuyaCameraActivatorBuilder()
    .setToken(token)
    .setPassword(password) // set wifi password
    .setSsid(ssid)
    .setListener(listener);

Parameter Description



Parameter
Description




token
active token


password
wifi password


ssid
wifi ssId


ITuyaSmartCameraActivatorListener
Callback



ITuyaCameraDevActivator
Network configuration interface implementation
ITuyaCameraDevActivator mTuyaActivator = TuyaHomeSdk.getActivatorInstance().newCameraDevActivator(builder);

Get Qrcode url information through Qrcode interface
mTuyaActivator.createQRCode();

start network configuration
Use the url to generate Qrcode, and confirm the device is in network configuration mode. Point the camera at the Qrcode, the device will emit a tone or switch the indicator once it get Qrcode information. Then monitor the configuration result by belowing interface:
// network configuration start
mTuyaActivator.start();

stop network configuration
The method is shown below:
//Stop configuration
mTuyaActivator.stop();

Network configuration result callback
Callback configuration result by ITuyaSmartCameraActivatorListener interface,
// callback interface
ITuyaSmartCameraActivatorListener() {

    /**
     * Qrcode generate successfully
     *
     * @param qrcodeUrl 
     */
    void onQRCodeSuccess(String qrcodeUrl);
    /**
     * error messege
     *
     * @param errorCode 
     * @param errorMsg  
     */
    void onError(String errorCode, String errorMsg);
    /**
     * active success
     *
     * @param devResp  device id
     */
    void onActiveSuccess(DeviceBean devResp);
};

Method description



Method
Description




onQRCodeSuccess
Generate QR code URL successfully callback, callback parameter is QR code URL address


onError
Error message


onActiveSuccess
Activated successfully



Callback destroy
//callback destroy
mTuyaActivator.onDestroy();


Sample code
//initialization callback interface
ITuyaSmartCameraActivatorListener mListener = new ITuyaSmartCameraActivatorListener() {
    /**
     * Qrcode generation success
     *
     * @param qrcodeUrl
     */
    public void onQRCodeSuccess(String qrcodeUrl){
        //use url to generate Qrcode
    }
    /**
     * error message
     *
     * @param errorCode 
     * @param errorMsg  
     */
    public void onError(String errorCode, String errorMsg){
        //The reason of failure and the list of error, reference AP\EZ network configuration
    }
    /**
     * active successfully
     *
     * @param devResp device id
     */
    public void onActiveSuccess(DeviceBean devResp){
        //subsequent operations

    }
};
TuyaCameraActivatorBuilder builder = new TuyaCameraActivatorBuilder()
    .setToken(token)
    .setPassword(password) // import wifi password
    .setSsid(ssid)
    .setListener(listener); 
ITuyaCameraDevActivator mTuyaActivator =    TuyaHomeSdk.getActivatorInstance().newCameraDevActivator(builder);
//generate Qrcode url
mTuyaActivator.createQRCode();
//configuration start
mTuyaActivator.start();
//configuration stop
mTuyaActivator.stop();
//callback destroy
mTuyaActivator.onDestroy();

